INSERT INTO serialized_object(name,description,type,subtype,serialization_class,serialized_data,date_created,creator,date_changed,changed_by,retired,date_retired,retired_by,retire_reason,uuid) VALUES ('SQL PARA A PRODUCAO DA LISTA DE PACIENTES COM EXAME DE CARGA VIRAL: TODAS CV NO PERIODO: INTEROPERABILIDADE (FSR)','Sao pacientes que tem exame de carga viral no periodo em referencia atraves da interoperabilidade - FSR. Se o paciente tiver dois ou mais exames de carga viral no periodo sera mostrado em duas ou mais linha no ficheiro excel','org.openmrs.module.reporting.dataset.definition.DataSetDefinition','org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition id=\"1\" uuid=\"83c8210e-7ece-433f-bd1f-6ff15d11e9de\" retired=\"false\">\n  <name>SQL PARA A PRODUCAO DA LISTA DE PACIENTES COM EXAME DE CARGA VIRAL: TODAS CV NO PERIODO: INTEROPERABILIDADE (FSR)</name>\n  <description>Sao pacientes que tem exame de carga viral no periodo em referencia atraves da interoperabilidade - FSR. Se o paciente tiver dois ou mais exames de carga viral no periodo sera mostrado em duas ou mais linha no ficheiro excel</description>\n  <creator id=\"2\" uuid=\"85a05c5e-1e3d-11e0-acca-000c29d83bf2\"/>\n  <dateCreated id=\"3\">2022-01-26 09:59:06 UTC</dateCreated>\n  <changedBy reference=\"2\"/>\n  <dateChanged id=\"4\">2022-12-21 10:57:24 UTC</dateChanged>\n  <parameters id=\"5\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"6\">\n      <name>startDate</name>\n      <label>Data Inicial</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>Data Final</label>\n      <type>java.util.Date</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"8\">\n      <name>location</name>\n      <label>US</label>\n      <type>org.openmrs.Location</type>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <id>2782</id>\n  <sqlQuery>select 	cargaViral.*,&#xd;\n		pid.identifier,&#xd;\n		concat(ifnull(pn.given_name,&apos;&apos;),&apos; &apos;,ifnull(pn.middle_name,&apos;&apos;),&apos; &apos;,ifnull(pn.family_name,&apos;&apos;)) nome,&#xd;\n		p.gender,&#xd;\n		timestampdiff(year,p.birthdate,:endDate) idade_actual&#xd;\nfrom &#xd;\n(	&#xd;\n	&#xd;\n	Select 	p.patient_id,&#xd;\n			date(e.date_created) vlDate,&#xd;\n			if(oCoded.concept_id is not null,			&#xd;\n				case oCoded.value_coded&#xd;\n					when 1306 then &apos;Nivel baixo de deteccao&apos;&#xd;\n					when 23814 then &apos;Indetectavel&apos;&#xd;\n					when 23905 then &apos;Menor que 10 copias/ml&apos;&#xd;\n					when 23906 then &apos;Menor que 20 copias/ml&apos;&#xd;\n					when 23907 then &apos;Menor que 40 copias/ml&apos;&#xd;\n					when 23908 then &apos;Menor que 400 copias/ml&apos;&#xd;\n					when 23904 then &apos;Menor que 839 copias/ml&apos;&#xd;\n					when 165331 then CONCAT(&apos;&lt;&apos;,oCoded.comments)&#xd;\n				else &apos;Outro&apos; end,  oNumerico.value_numeric) vlValue		&#xd;\n	from 	patient p &#xd;\n			inner join encounter e on e.patient_id=p.patient_id&#xd;\n			left join obs oNumerico on oNumerico.encounter_id=e.encounter_id and &#xd;\n						oNumerico.voided=0 and oNumerico.concept_id=856&#xd;\n			left join obs oCoded on oCoded.encounter_id=e.encounter_id and &#xd;\n						oCoded.voided=0 and oCoded.concept_id=1305&#xd;\n	where 	p.voided=0 and e.voided=0 and e.encounter_type=51 and  &#xd;\n			e.location_id=:location and date(e.date_created) between :startDate and :endDate 	&#xd;\n)cargaViral&#xd;\ninner join person p on p.person_id=cargaViral.patient_id&#xd;\nleft join &#xd;\n(	select pid1.*&#xd;\n	from patient_identifier pid1&#xd;\n	inner join &#xd;\n		(&#xd;\n			select patient_id,min(patient_identifier_id) id &#xd;\n			from patient_identifier&#xd;\n			where voided=0&#xd;\n			group by patient_id&#xd;\n		) pid2&#xd;\n	where pid1.patient_id=pid2.patient_id and pid1.patient_identifier_id=pid2.id&#xd;\n) pid on pid.patient_id=cargaViral.patient_id&#xd;\nleft join &#xd;\n(	select pn1.*&#xd;\n	from person_name pn1&#xd;\n	inner join &#xd;\n		(&#xd;\n			select person_id,min(person_name_id) id &#xd;\n			from person_name&#xd;\n			where voided=0&#xd;\n			group by person_id&#xd;\n		) pn2&#xd;\n	where pn1.person_id=pn2.person_id and pn1.person_name_id=pn2.id&#xd;\n) pn on pn.person_id=cargaViral.patient_id&#xd;\norder by cargaViral.patient_id,cargaViral.vlDate</sqlQuery>\n</org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition>','2022-01-26 11:59:06',1,'2022-12-21 12:57:24',1,0,NULL,NULL,NULL,'83c8210e-7ece-433f-bd1f-6ff15d11e9de')
